Episode Title: &quot;Grooming Gone Wrong; Father-Daughter Car Dispute&quot;
Episode Order: Season 18, Episode 97
Original Air Date: December 12, 2013

&quot;A dog's owners say the groomer gave it a heat stroke; a young woman sues her father for the money she paid for a car, and he countersues for the unpaid balance and impound fees.&quot;

Seed and enjoy!
